('node', 'article', 0, 2, 2, 'und', 0, '<pre class="brush:php">\r\n\r\n<div class="header">\r\n<h1><?php\r\n      $welcome = "Let''s get started with PHP!";\r\n      echo $welcome;\r\n      ?></h1>\r\n</div>\r\n\r\n<p><strong>Generate a list:</strong> <?php\r\n      for ($number = 1; $number <= 10; $number++) {\r\n        if ($number <= 9) {\r\n            echo $number . ", ";\r\n        } else {\r\n            echo $number . "!";\r\n        }\r\n      }; ?></p>\r\n\r\n<p><strong>Things you can do:</strong> <?php\r\n        $things = array("Talk to databases",\r\n        "Send cookies", "Evaluate form data",\r\n        "Build dynamic webpages");\r\n        foreach ($things as $thing) {\r\n            echo "<li>$thing</li>";\r\n        }\r\n        \r\n        unset($thing);\r\n      ?></p>\r\n\r\n<p><strong>This jumbled sentence will change every time you click Submit!</strong></p>\r\n\r\n<p><strong><strong><?php\r\n        $words = array("the ", "quick ", "brown ", "fox ",\r\n        "jumped ", "over ", "the ", "lazy ", "dog ");\r\n        shuffle($words);\r\n        foreach ($words as $word) {\r\n            echo $word;\r\n        };\r\n        \r\n        unset($word);\r\n      ?> </strong></strong></p>\r\n</pre>', '', 'full_html');
